#include<iostream>

using namespace std;

void addfive(int& a, int& b){//this line addfive function (int& a) = &
//   (int& b) = &
// & this wil update value. without this "&" it will not update on addfive function.

// This function add 5 to a and b temporarily sence they call by value
cout << "Entering addfive function" << endl;
cout << "a and b before adding 5 : a=" << a <<" b="<< b << endl<<endl;
a += 5;
b += 5;
cout << "a and b after adding 5 : a=" << a << " b="<< b << endl<<endl;
cout << "Leving addfive function"<< endl<<endl;
}

int main(){
int a = 10;
int b = 15;

cout << "a and b before calling addfive function a="<< a<< " b= "<< b<< endl<<endl;

addfive(a,b);

cout << "a and b after calling addfive function a=" << a<< " b="<< b << endl<<endl;

return 0;
}

